function charInfos({ messages }) {
  return (
    <div className=''>
      <ul className="divide-y divide-gray-200 flex flex-wrap mx-1 lg:-mx-4 m-4 ">
        {messages.map((person) => (
          <div className="max-w-sm bg-white border border-gray-200 rounded-xl shadow-md dark:bg-gray-800 dark:border-gray-700">
            <img className="m-10  rounded-t-lg" src={person.image} alt="" />
            <div className="p-5">
              <h5 className="mb-2 text-2xl font-bold tracking-tight text-gray-900 dark:text-white">{person.name}</h5>
              <p className="mb-3 font-normal text-gray-700 dark:text-gray-400">{person.species}</p>
            </div>
          </div>







